import React from 'react'; 

interface ItemProps {
    name: string;
    team?: number;
    email: any;
}

const Item = (props: ItemProps) => (
    <aside className="Item" >
        <ul>
            <li><b>Name:</b> {props.name}, Teams:{props.team}</li>
            <li><b>Email:</b> {props.email}</li>
        </ul>
    </aside>
)

export default Item

